import React from 'react';
import './Listitem.css';

function List(props){
    const items = props.item;
    const listItems = items.map(item => {
        return <div className="list" key="item.key">
            <p>{item.text}</p>
        </div>
    })
    return(
        <div>
            {listItems}
        </div>
    )
}

export default List;
